import React from "react";
import { Link } from "react-router-dom";

function Home() {
  return (
    <div>
      <h2>歡迎來到車用零件管理系統</h2>
      <Link to="/inventory">進入庫存管理</Link>
    </div>
  );
}
export default Home;
